import React, {useEffect, useState} from 'react';
import { Books } from "./components/Books"

function App() {
  const [isbn, setBooks] = useState([])

  useEffect(()=> {
    fetch('/books/all').then(response =>
      response.json().then(data => {
        setBooks(data)      
      })
    );
  }, [])

  console.log(data);

  return (<div className="App">
    <Books books= {isbn}/>
  </div>);
}

export default App;
